// export default App;
import React from 'react';
import './FrontPage.css';
import { Link } from 'react-router-dom';

const columns = [
    { key: 'firstName', label: 'FIRSTNAME' },
    { key: 'lastName', label: 'LASTNAME' },
    { key: 'email', label: 'EMAIL' },
    { key: 'mobileNumber', label: 'MOBILENUMBER' },
    { key: 'dob', label: 'DOB' },
];

function FrontPage() {

    return (
        <div className="App">
            <div className="logo">
                <img id="logo1" src="https://divum.in/images/logo/Divum_Logo%20SVG%20(2).svg" alt="Logo" />
            </div>
            <table>
                <thead>
                    <tr>
                        {columns.map(column => (
                            <th key={column.key}>{column.label}</th>
                        ))}
                    </tr>
                </thead>
            </table>
            <div className="btn">
                <button>ADD</button>
                <Link to="/login" >Add</Link>
            </div>
        </div>
    );
}

export default FrontPage;
